    const val lexikon =
        "[{\"id\":\"1\",\"title\":\"Bistro\",\"description\":\"Nat\\u00fcrlich ist f\\u00fcr deine Verpflegung bei den Hauptmahlzeiten bestens gesorgt. Es geht aber nichts \\u00fcber einen leckeren Snack zu sp\\u00e4ter Stunde. Wenn dein Magen nach den Abendveranstaltungen wieder knurrt, dann laden wir dich herzlich in unser Bistro im kleinen Verpflegungszelt 1 ein. Den kleinen Abendsnack gibt es dort zwischen 21:30 Uhr und 23:30 Uhr: Crepes, Flammkuchen und andere Leckereien. Eis und kalte Getr\\u00e4nke gibt es den ganzen Tag \\u00fcber im Foyer und abends auch im Bistro.\"},{\"id\":\"2\",\"title\":\"B\\u00fccher, Musik und Mehr\",\"description\":\"In unserem Buchladen neben der Cafe-Lounge findest du unter anderem die B\\u00fccherm die von den Referenten empfohlen werden. Schau doch mal vorbei. Ge\\u00f6ffnet haben wir t\\u00e4glich au\\u00dferhalb der Veranstaltungen im Plenum zwischen 11:00Uhr und 22:00Uhr\\nBeim Lesen m\\u00fcde geworden? Dann haben wir ein koffeinhaltiges Angebot f\\u00fcr dich: wer in der B\\u00fccherstube f\\u00fcr mehr als 20,- Euro einkauft, erh\\u00e4lt einen Gutschein f\\u00fcr einen Kaffee in der cafe-lounge.\"},{\"id\":\"3\",\"title\":\"Bustransfer\",\"description\":\"Wir haben einen Pendelverkehr von\\/zu den Massenquatieren eingerichtet. Du kannst ihn \\u00fcber den unteren Button anzeigen lassen (noch nicht implementiert)\\nBitte beachte auch entsprechende Ansagen im Programm!\"},{\"id\":\"4\",\"title\":\"Cafe-Lounge\",\"description\":\"F\\u00fcr alle die zwischen dem Fr\\u00fchst\\u00fcck und dem Schlafengehen nicht auf Koffein verzichten k\\u00f6nnen, bieten wir im Bistrobereich des EC-FSZ eine gro\\u00dfe Auswahl an Kaffeespezialit\\u00e4ten und kleinen Snacks. Ein Schlaraffenland f\\u00fcr alle Kaffee-kenner und -Genie\\u00dfer: Umgeben vom Duft der frisch gemahlenen Bohnen kannst du die Entstehung deines Kaffes live verfolgen. Was alles deinen Puls auf touren bringt und zum Verweilen einl\\u00e4d, findest du direkt an der Cafe-Lounge. Schau einfach mal auf einen Espresso vorbei.\"},{\"id\":\"5\",\"title\":\"Coffee-Time-Reflexionsrunde\",\"description\":\"In gem\\u00fctlicher Atmosph\\u00e4re zusammen mit den anderen Leuten aus deiner Jugendarbeit die vielen Impulse und Anregungen innerhalb der eigenen Jugendarbeit reflektieren, wo du pers\\u00f6nlich herausgefordert wurdest, was du zuhause beherzt angehen willst und wie die eigene Jugendarbeit\\/Gemeinde vorangebracht werden kann. Sucht euch zusammen ein lauschiges Pl\\u00e4tzchen und genie\\u00dft nebenher eine Runde Kaffee und Donuts. Diese k\\u00f6nnt ihr in Kisten voher im gro\\u00dfen Verpflegungszelt (bitte Beschilderung achten!) abholen und anschlie\\u00dfend im Sp\\u00fclzelt abgeben.\\nDie Gespr\\u00e4chsanregungen zu den jeweiligen Tagen und wie es nach paXan in deiner Jugendarbeit weitergehen kann findest du unter 'Info'.\"},{\"id\":\"6\",\"title\":\"Einlass\",\"description\":\"Beim Check-In hast du aufgrund deiner Anmeldung ein Lanyard mit Namensschild bekommen. Bitte trage dieses w\\u00e4hrend der gesamten Zeit sichtbar bei dir. Solltest du dein Namensschild verloren haben, melde dich im Kongressb\\u00fcro.\"},{\"id\":\"7\",\"title\":\"Erste Hilfe\",\"description\":\"Bei Verletzungen oder gesundheitlichen Problemen kannst du dich im Kongressb\\u00fcro oder im Notfall unter 012345678 melden.\"},{\"id\":\"8\",\"title\":\"Fundsachen\",\"description\":\"Falls du etwas gefunden oder verloren hast, kannst du es im Kongressb\\u00fcro abgeben oder abholen.\"},{\"id\":\"9\",\"title\":\"Gep\\u00e4ck\",\"description\":\"Dein Gep\\u00e4ck kannst du am An- und Abreisetag im Auto lassen.\\nAu\\u00dferdem haben wir einen Gep\\u00e4ck-Shuttle-Service f\\u00fcr dich eingerichtet.\\nAm Anreisetag solltest du dein Gep\\u00e4ck in der Garage beim ZEITRAUM-Haus (Wildbader Stra\\u00dfe 55) abgeben. Von dort wird es ins Massenquatier transportiert, wo du dann selbst wieder daf\\u00fcr verantwortlich bist. Vom Shuttle-Service ausgenommen sind die Massenquatiere Dobel und die Privatquatiere.\\nNach M\\u00f6glichkeit sollte am Abreisetag kein Gep\\u00e4ck auf das Gel\\u00e4nde des EC-FSZ gebracht werden. Sollte dies sich nicht vermeiden lassen, dann kann deine Tasche nur im daf\\u00fcr vorgesehenen Schwarzwaldzimmer zwischengelagert werden.\\nDas Gep\\u00e4ck darf nicht in die Halle oder Zelthalle genommen werden.\"},{\"id\":\"10\",\"title\":\"Info-St\\u00e4nde\",\"description\":\"An den St\\u00e4nden in der Zelthalle kannst du dich mit Materialien eindecken, informieren und Fragen stellen.\"},{\"id\":\"11\",\"title\":\"Kneipe\",\"description\":\"Lust auf lockere Gespr\\u00e4che mit kleinen Snacks und leckeren, alkoholfreien Longdrinks? Chillen, genie\\u00dfen, Musik h\\u00f6ren und neue Leute kennen lernen? Dann bist du nach den Abendveranstaltungen in die Knepe im Tagungsraum 2.3\\/2.4 eingeladen.\"},{\"id\":\"12\",\"title\":\"Kongressb\\u00fcro\",\"description\":\"Das Kongressb\\u00fcro findest du rechts vom Haupteingang bei der Empfangstheke im EC-FSZ. Sollte dies einmal kurzfristig nicht besetzt sein, bekommst du Hilfe unter 07083\\/92580. Diese Nummer bitte nur in Notf\\u00e4llen verwenden.\"},{\"id\":\"13\",\"title\":\"Massenquatiere\",\"description\":\"Die M\\u00e4nner sind in der Dobeltalhalle und in der Schule in Bad Herrenalb untergebracht. Die Damen \\u00fcbernachten in der Grundschule, Schulsporthalle im Gemeindehaus in Dobel oder in der bronnenwiesenhalle in Neusatz.\\nIn welchem Massenquartier du untergebracht bist, hast du beim Einchecken erfahren. Bitte beachte, dass nach 0:40 Uhr kein Einlass mehr m\\u00f6glich ist!\\nWie das mit dem Duschen funktioniert, erf\\u00e4hrst du im Massenquartier vor Ort. Alles weitere wissen die Ordner im Quartier.\\nFalls du tags\\u00fcber in dien Massenquartier musst, ist dies von 12:45Uhr bis 13:45 Uhr m\\u00f6glich.\"},{\"id\":\"14\",\"title\":\"MP3\",\"description\":\"Du h\\u00f6rst so viel gutes bei den Bibelarbeiten und Referaten, dass du total geflasht bist und eigentlich die ganze Bibelarbeit noch ein zweites Mal anh\\u00f6ren willst? \\nNach paXan werden wir dir an deine Mailadresse einen Link schicken, \\u00fcber den du dir die Bibelarbeiten nocheinmal anh\\u00f6ren kannst.\"},{\"id\":\"15\",\"title\":\"Opfer\",\"description\":\"Infos \\u00fcber die Opferprojekte erh\\u00e4ltst du in den Veranstaltungen. Am Sonntag und montag hast du die Gelegenheit, w\\u00e4hrend des Programms ein Opfer einzulegen. Ansonsten steht auch eine Spendenbox beim Kongressb\\u00fcro bereit. Vielen Dank! Bitte beachte auch die weiteren Infos zu Spenden (Im Info Tab)\"},{\"id\":\"16\",\"title\":\"Parken\",\"description\":\"Bitte auf dem gro\\u00dfen \\\"Mannenbachparkplatz\\\" am Waldrand Richtung Eyach oder am Parkplatz richtung Neuenb\\u00fcrg kommend parken.\"},{\"id\":\"17\",\"title\":\"Rauchen\",\"description\":\"Auf dem paXan Gel\\u00e4nde herrscht Rauchverbot. Das Rauchen ist nur im daf\\u00fcr vorgesehenen Bereich vor den Garagen unterhalb des Schachfeldes gestattet.\"},{\"id\":\"18\",\"title\":\"R\\u00fcckzugsm\\u00f6glichkeit\",\"description\":\"\"},{\"id\":\"19\",\"title\":\"Stille Zeit am Morgen\",\"description\":\"\"},{\"id\":\"20\",\"title\":\"Toiletten\",\"description\":\"\"},{\"id\":\"21\",\"title\":\"Verpflegung\",\"description\":\"\"},{\"id\":\"22\",\"title\":\"Zeitraum\",\"description\":\"\"},{\"id\":\"23\",\"title\":\"Zelten\",\"description\":\"\"}]"

